import React from 'react';
import {IoCloseCircleSharp} from "react-icons/io5";

const Items = (props) => {

    let list = props.list

    return (
        <div className="List">
        {list.map((item,id) => (
                <div
                    className="Element" key={id}>{id+1}. {item}
                    <IoCloseCircleSharp onClick={() => props.deleteItem(item)} className="icon"/>
                </div>
            ))}
        </div>
    );
};

export default Items;
